package com.mycompany.veterinaria.service;import com.mycompany.veterinaria.model.Duenho;import com.mycompany.veterinaria.repository.IDuenhoRespository;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import java.util.List;@Servicepublic class DuenhoService implements  IDuenhoService{    @Autowired(required = true)    private IDuenhoRespository duenhoRespository;    @Override    public void saveDuenho(Duenho duenho) {        duenhoRespository.save(duenho);    }    @Override    public void deleteDuenho(Long idDuenho) {        duenhoRespository.deleteById(idDuenho);    }    @Override    public List<Duenho> getDuenhos() {        List<Duenho> duenhoList = duenhoRespository.findAll();        return duenhoList;    }    @Override    public void editDuenho(Duenho duenho) {        this.saveDuenho(duenho);    }    @Override    public Duenho findOneDuenho(Long idDuenho) {        Duenho duenho = duenhoRespository.findById(idDuenho).orElse(null);        return duenho;    }}